        <div class="typo_cont flex justify-between">
            <div class="typo_left">
                <div class="txt pt-4 max-w-[40ch]">Tipografía de apoyo y decorativa. Foundry Plek W01 es una sans serif diseñada a partir de una matriz de puntos y publicada por la fundición The Foundry Types. Coincide con nuestros conceptos gráficos que parten del punto y se suele usar convencionalmente para correspondencia seria. En este caso podemos explorar un lenguaje gráfico diferente en las aplicaciones como cartelería y señalética para transmitir la identidad de la marca en todos los soportes.</div>
